import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import Seconds from "./Seconds";

import "./App.css";
import "./reset.css";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route path="/" element={<Seconds />}></Route>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
